import React, { Component } from "react";
import {  Input, Table, Card, Button } from 'antd';
import { SearchOutlined, PlusOutlined, CheckSquareOutlined,CloseCircleOutlined } from '@ant-design/icons';
import styles from './css/index.moudle.css'
import { Link } from 'react-router-dom'
import axios from '../../axios'
let meetdata = [];

const { Search } = Input;

const columns = [{
    title: '会议主题',
    dataIndex: 'roomName',
    width: '20%',
    align: 'center'
}, {
    title: '创建时间',
    dataIndex: 'createDate',
    width: '20%',
    align: 'center'
}, {
    title: '会议号',
    dataIndex: 'isPublic',
    align: 'center'
}, {
    title: '状态',
    dataIndex: 'lockStatus',
    align: 'center'
},
{
    title: '操作',
    dataIndex: 'id',
    align: 'center'
}
]

const onSearch = value => console.log(value);

class MeetList extends Component {


    constructor(props) {
        super(props)
        this.state = {}
    }

    componentDidMount() {

        var params = { page: 1 };
        this.getMeetData(params);

    }

    getMeetData(params) {
        axios.getMeetList(params).then((res) => {
            console.log(res)
            meetdata = res.response.data;

            

        })
    }
    //检索
    SearchMeet() {
        alert(this.name.value)
        var params = { page: 1, key: this.name.value};
        this.getMeetData(params);
    }
    //审核课程
    CheckMeet() {

    }


    render() {

        return (
            <Card title="会议列表"  >

                <Input.Group compact>
                    <Search
                      
                        placeholder="视频会议关键字"
                        allowClear
                        enterButton="搜索"
                        size="large"
                        ref={i => this.name = i}
                        style={{ width: '40%' }}
                        onSearch={this.SearchMeet}
                    />
                    

                    <Button type="primary" style={{ marginLeft: '2%' }} size="large" icon={<PlusOutlined />} onClick={this.SearchMeet}  >新建会议</Button>

                    <Button type="primary" style={{ marginLeft: '2%' }} size="large" icon={<CheckSquareOutlined />} onClick={this.CheckMeet}  >审核通过</Button>
                </Input.Group>

                <br/>

                <Table bordered
                    dataSource={meetdata}
                    columns={columns}
                  
                    pagination={{ position: ['none', 'bottomRight'] }}
                > </Table>
            </Card>
        )
    }
}

export default MeetList
